# https://leetcode.com/problems/substring-with-concatenation-of-all-words/
# You are given a string, s, and a list of words, words, that are all of the same length.
# Find all starting indices of substring(s) in s that is a concatenation of each word in
# words exactly once and without any intervening characters.
#
# Example 1:
#
# Input:
#   s = "barfoothefoobarman",
#   words = ["foo","bar"]
# Output: [0,9]
# Explanation: Substrings starting at index 0 and 9 are "barfoor" and "foobar" respectively.
# The output order does not matter, returning [9,0] is fine too.
# Example 2:
#
# Input:
#   s = "wordgoodgoodgoodbestword",
#   words = ["word","good","best","word"]
# Output: []


def find_all_concatenations(words, s):
    word_len = len(words[0])
    pos_concatenated_word_len = word_len * len(words)
    if pos_concatenated_word_len > len(s):
        return []
    out = set()

    def helper(words, output, out):
        if len(words) == 0:
            out.add(output)
        else:
            for index in range(len(words)):
                current_word = words.pop(index)
                x = s.find(output + current_word)
                if x >= 0 and len(s[x + 1:]) >= pos_concatenated_word_len - len(output + current_word):
                    helper(words, output + current_word, out)
                words.insert(index, current_word)

    helper(words, '', out)
    print(out)
    result = []
    start_index = 0
    for concate in out:
        i = s.find(concate, start_index)
        if i >= 0:
            result.append(i)
            while i >= 0 and len(concate) <= len(s[i + 1:]):
                i = s.find(concate, i + 1)
                if i > 0:
                    result.append(i)
    return result


